For debugging anything in Rust using VS Code, one essential resource is the Cargo Targets page of the Cargo Book. It turns out that there are a few more target types than simple binary targets (applications, defined in src/main.rs) and library targets (defined in src/lib.rs). For example, it's possible to declare additional binary targets, with the source going in src/bin/target_name.rs, but each one of these requires a separate section in cargo.toml, plus a way to tell the debugger (via launch.json) which of these we want to run. That solution would work, but it would be much more high maintenance than we wanted. Fortunately, the next piece of Cargo-ie goodness that we bumped into turned out to be just the thing we needed for our RustAssured snippets. This was the examples directory . It turned out we could add any rust "executable" src file (i.e., a file with a main method) to that directory, and as long as we had a minimal cargo.toml in the root, we could run the file <root>/examples/expressions.rs (for example) with the cargo command cargo run --example expressions. Here's all we need for our minimal cargo.toml file, which we placed in the root of the repository: [package]
name = "unused"
version = "0.1.0" Now hang in there with me -- I know this is a lot of explanation, but believe it or not, we're almost done! We have our extensions installed, our breakpoint setting set, and our stub cargo.toml file. The only thing left to do is to add (or edit) the file .vscode/launch.json to contain this configuration: { "configurations": [ { "type": "lldb", "request": "launch", "name": "Debug current examples file", "cargo": { "args": [ "run", "--example", "${fileBasenameNoExtension}" ] }, "args": [] } ]
} It's possible to modify this to include whatever name you want and run any cargo command, for example, to run tests. As written, it debugs the current file in the examples directory, so I can set a breakpoint to run these two lines of Swinging on a Star , by Bing Crosby, one line at a time. If that sort of life is what you wish...You may grow up to be a fish! And of course, now that I know that Bing Crosby's two lines about a fish work OK, what kind of a bad person would I be if I didn't let you run them in the browser, too? Just click on the code below to see the run button: fn main() { let lines = [ "A fish won't do anything but swim in a brook.".to_string(), "He can't write his name or read a book.".to_string() ]; for line in lines.iter() { println!("{}", line); } }

